syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";

import "InstableSprayTeamInfo.proto";

// Name: KPMFNAPKPOK
message InstableSprayStageInfo {
    repeated InstableSprayTeamInfo team_info_list = 14;
    bool is_finished = 1;
    uint32 stage_id = 3;
    uint32 max_score = 11;
}

